import React, { Component } from 'react';

import Form from 'react-bootstrap/Form'

class FilterList extends Component {
    render() {
        return (
            <Form>
                <Form.Check type={'checkbox'} label={'Mage'} />
            </Form>
        )
    }
}

export default FilterList
